import React from 'react';

export default function LoginPage() {
  return (
    <div>
      <h1>이메일과 비밀번호를 입력해주세요</h1>
      <form>
        <label htmlFor="emailName">
          이메일 주소
          <input
            name="emailName"
            type="text"
            value={email}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label htmlFor="emailName">
          비밀번호
          <input
            name="emailName"
            type="text"
            value={email}
            onChange={handleInputChange}
          />
        </label>
      </form>
    </div>
  );
}
